import React from 'react';
import { Box, ModalBody, Heading } from '@chakra-ui/react';

const Ed = () => {
  return (
    <Box>
      <ModalBody>
        The introductory computer science courses at the University of
        Washington shifted from using GradeIt as their primary grading platform
        to Ed instead.
      </ModalBody>
    </Box>
  );
};

export default Ed;
